import "./index.css";
import React, { useContext } from 'react'
import { ContextGlobal } from './utils/global.context'

function App() {
  return (
      <div className="App">
       

          <Navbar/>
          <main>
          <Outlet />
        </main>
          <Footer/>
       
      </div>
  );
}

export default App;
